import React from "react";
import style from "../styles/Character.module.css";

function Character() {
  return (
    <div className={style.pancarte}>
      <img src="assets/pdp.png" alt="photo représentative à 90%" />
      <p>DEVELOPPEUR WEB FULLSTACK JUNIOR</p>
      <p>LAFAYE NICOLAS</p>
      <p>06-84-98-17-09</p>
    </div>
  );
}

export default Character;
